    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick(nums, k):
            drop = len(nums) - k
            out = []
            for num in nums:
                while drop and out and out[-1] < num:
                    out.pop()
                    drop -= 1
                out.append(num)
            return out[:k]

        def merge(nums1, nums2, k):
            out = []
            while nums1 and nums2 and k:
                if nums1 > nums2:
                    out.append(nums1.pop(0))
                else:
                    out.append(nums2.pop(0))
                k -= 1
            out += nums1 + nums2
            return out[:k]

        return max(merge(pick(nums1, i), pick(nums2, k - i), k) for i in range(k + 1) if i <= len(nums1) and k - i <= len(nums2))

