        """
        :type stickers: List[str]
        :type target: str
        :rtype: int
        """

        # 1. build a dict for each sticker
        # 2. build a dict for each letter in target
        # 3. iterate through target, for each letter, find the sticker with the most letters
        # 4. add the sticker to the target
        # 5. repeat until target is empty
