                sticker_dict[sticker][letter] = sticker_dict[sticker].get(letter, 0) + 1

        # build a dict for each letter in target
        target_dict = {}
        for letter in target:
            target_dict[letter] = target_dict.get(letter, 0) + 1

        # iterate through target, for each letter, find the sticker with the most letters
        # add the sticker to the target
        # repeat until target is empty
        # return the number of stickers used
