        sticker_len = len(sticker_dict)
        sticker_count = 0
        while target_len > 0:
            sticker_count += 1
            new_target_dict = {}
            for letter in target_dict:
                new_target_dict[letter] = new_target_dict.get(letter, 0)
                for sticker in sticker_dict:
