    def findComplement(self, num):
        """
        :type num: int
        :rtype: int
        """

        # 1. convert to binary
        # 2. flip bits
        # 3. convert back to decimal

        # 1. convert to binary
        binary = bin(num)[2:]

        # 2. flip bits
        flipped = ""
        for bit in binary:
            if bit == "0":
                flipped += "1"
            else:
                flipped += "0"

        # 3. convert back to decimal
        return int(flipped, 2)

