                    cols.add(col)
                    diag1.add(row + col)
                    diag2.add(row - col)
                    count += backtrack(row + 1, cols, diag1, diag2)
                    cols.remove(col)
                    diag1.remove(row + col)
                    diag2.remove(row - col)
            return count

        return backtrack(0, set(), set(), set())

